import React, { useState } from 'react';
import Container from './components/Container/Container';
import IntroPage from './components/gameScreen/introPage/IntroPage';

function App() {
  const [currentScreen, setCurrentScreen] = useState(<IntroPage setGameScreen={setCurrentScreen} />);

  return (
    <Container gameScreen={currentScreen} />
  );
}
export default App;
